function parseCSV(csv) {
  var lines = csv.split('\n');
  var result = {};
  var headers = lines[0].split(';');

  for (var i = 1; i < lines.length; i++) {
    var currentline = lines[i].split(';');

    // Skip empty lines or lines that do not have the correct number of fields
    if (currentline.length !== headers.length || currentline.some(field => field.trim() === '')) {
      continue;
    }

    var obj = {};

    for (var j = 0; j < headers.length; j++) {
      obj[headers[j].trim()] = currentline[j].trim();
    }

    // Converte cmdstatusnumber para inteiro para garantir a comparao correta
    obj.cmdstatusnumber = parseInt(obj.cmdstatusnumber);

    var key = obj.cmdstatus + '_' + obj.cmdstatusnumber; // chave nica baseada em cmdstatus e cmdstatusnumber
    result[key] = obj;
  }

  return result;
}

